(841, '<p>\n	&nbsp;</p>\n<h1 class="mhl" style="margin-left: 20px; margin-right: 20px; color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">\n	Photo booth that&#39;s TERRIFIC for your events! We make you smile and laugh at the same time.. :D</h1>\n<div class="mhl" style="margin-left: 20px; margin-right: 20px; color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">\n	<div class="mvm uiP fsm" style="margin-top: 10px; margin-bottom: 10px; line-height: 16px; ">\n		&nbsp;</div>\n</div>\n<p>\n	&nbsp;</p>\n'),
(842, '<p>\n	&nbsp;</p>\n<div class="mhl" style="margin-left: 20px; margin-right: 20px; color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">\n	Photo booth that&#39;s TERRIFIC for your events! We make you smile and laugh at the same time.. :D</div>\n<div class="mhl" style="margin-left: 20px; margin-right: 20px; color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">\n	<div class="mvm uiP fsm" style="margin-top: 10px; margin-bottom: 10px; line-height: 16px; ">\n		<span class="fwb" style="font-weight: bold; ">Description</span></div>\n	<div class="text_exposed_root text_exposed" id="id_500d01272f2f48e27256350" style="display: inline; ">\n		A DTI registered Photo Booth rental that is terrific for your:<br />\n		<br />\n		-Events&nbsp;<br />\n		-Debuts<br />\n		-Birthdays<br />\n		<span class="text_exposed_show" style="display: inline; ">-Corporate Events<br />\n		-Exhibits<br />\n		-Christmas Parties<br />\n		-Children&#39;s Party<br />\n		-School Fair<br />\n		-Fund Raising Program<br />\n		-Family Day<br />\n		-Weddings<br />\n		-Anniversaries<br />\n		-Baptisms<br />\n		-Dedication<br />\n		<br />\n		or any occasion that you want! :D</span></div>\n</div>\n<p>\n	&nbsp;</p>\n'),
(844, '<p>\n	<strong><span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">PHOTO BOOTH RENTAL PACKAGES:</span></strong></p>\n<p>\n	<br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; " />\n	<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">&bull; JACK -- 1 HOUR UNLIMITED PHOTO BOOTH SERVICE &ndash; P4,000</span><br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; " />\n	<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">&bull; QUEEN -- 2 HOURS UNLIMITED PHOTO BOOTH SERVICE &ndash; P5,000</span><br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; " />\n	<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">&bull; KING -- 3 HOURS UNLIMITED PHOTO BOOTH SERVICE &ndash; P7,000</span><br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; " />\n	<span class="text_exposed_show" style="display: inline; color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; ">&bull; ACE -- 4 HOURS UNLIMITED PHOTO BOOTH SERVICE &ndash; P8,000<br />\n	&bull; FULL HOUSE -- 5 HOURS UNLIMITED PHOTO BOOTH SERVICE &ndash; P9,000<br />\n	<br />\n	<strong>PACKAGE INCLUDES:</strong><br />\n	<br />\n	&bull; UNLIMITED QUALITY PRINTS<br />\n	&bull; CREATIVE LAYOUT PRINTED ON 4R SIZE PRINTS<br />\n	&bull; DIGITAL COPY OF PHOTOS IN DVD<br />\n	&bull; ONLINE PHOTO GALLERY (FACEBOOK, MULTIPLY &amp; GOOGLE + )<br />\n	&bull; TWO ON SITE TECHNICIANS<br />\n	&bull; FREE USE OF PROPS<br />\n	&bull; DELIVERY &amp; SET UP OF PHOTO BOOTH WITHIN METRO MANILA<br />\n	&bull; PERSONALIZED BACKDROP TARPAULINE<br />\n	&bull; UNLIMITED STANDEES<br />\n	<br />\n	<strong>EXTRA:</strong><br />\n	<br />\n	&bull; ADDITIONAL EXTRA HOUR &ndash; P1,000<br />\n	&bull; OUT OF TOWN FEE &ndash; P2,000 (DEPENDING ON LOCATION)<br />\n	&bull; RESERVATION FEE &ndash; P2,000</span></p>\n'),
