(865, '<p>\n	<font face="Myriad Pro" size="5">Welcome to Palaganas Projects</font></p>\n<p style="font-size: 12px;">\n	We cater to the needs of artists and collectors. Based in the cool mountain city of Baguio, we provide artists with what they need to be able to create their art. As artists ourselves, we know about the frustrations inherent in the act of creation. Need materials? Call us anytime, day or night. Wanna talk about ideas or just need to unwind? That&#39;&#39;s in the works.</p>\n<p style="font-size: 12px;">\n	Collectors can check us out as well. If we don&#39;t have what you need, we will help you source out the particular art object you are looking for.&nbsp;</p>\n<p>\n	<span style="font-size: 20px; font-family: Myriad Pro;">Services</span></p>\n<ul style="font-size: 12px;">\n	<li>\n		Your sure supply of art materials: good quality oil paints, acrylics, brushes, pencils, sketch pads.</li>\n	<li>\n		Need books and references? We might have what you are looking for!</li>\n	<li>\n		Art consultancy services.</li>\n	<li>\n		Great art.</li>\n</ul>\n'),
(866, '<p>\n	<font face="Myriad Pro" size="5">Origins Of The Projects</font></p>\n<p style="font-size: 12px;">\n	From Manila to Mindanao, the Projects have recently moved to Baguio City. Educated in the best university in the Philippines, immersed in the local art scene in Mindanao, Palaganas Projects is now ready to strike it out in the cool clouds.&nbsp;</p>\n<p style="font-size: 12px;">\n	We started out as art students, with the same needs and requirements as any art student struggling to make it in this profession. Thus we aim to cater to the needs of this niche as a service to the struggling artist that we once were.&nbsp;</p>\n<p style="font-size: 12px;">\n	We have tested the waters in the gallery scene as artists ourselves, thus we know the needs of this special group of artists too. We provide professional grade art materials if in stock, and upon order. We can facilitate handling and delivery of artworks as well.&nbsp;</p>\n<p style="font-size: 12px;">\n	As veteran art and cultural workers, we provide consultancy services to your art projects.&nbsp;</p>\n<p style="font-size: 12px;">\n	We also welcome art collectors and afficionados.</p>\n'),
