(914, '<h1>\n	WeBuy4u</h1>\n<hr />\n<p>\n	&nbsp;</p>\n<div>\n	<strong>WeBuy4u</strong> is an online shopping service that aims to make your shopping experience on the web fun and convenient. No need to worry about placing orders or shipping arrangements because we&#39;ll take care of these for you. Just go to the Shopping List menu and add the links of the items you want to buy from any online shops in the Philippines and the US* and we&#39;ll do the rest!</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<address>\n	*applicable only to US online shops that accept credit cards issued in the Philippines</address>\n'),
