(1081, '<p>\n	<font face="''Myriad Pro''" size="5">Installment House and Lot Packages from Amaia Scapes Pangasinan</font><br />\n	Amaia Scapes soon to open in pangasinan, watch out for its launching and prepare to have your dream home on its affordable price.<br />\n	Sa Amaia<br />\n	Kaya ko na!!</p>\n<p>\n	<span style="font-family: ''Myriad Pro''; font-size: x-large; ">House and lot packages to be offered in Pangasinan</span></p>\n<p>\n	<span style="font-family: ''Myriad Pro''; font-size: x-large; "><img alt="" src="http://amaiapangasinan.weebly.com/uploads/8/3/4/0/8340752/9577185.jpg" style="padding-top: 5px; padding-right: 5px; padding-bottom: 5px; padding-left: 5px; margin-right: 5px; border-top-width: 2px; border-right-width: 2px; border-bottom-width: 2px; border-left-width: 2px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; float: left; width: 250px; height: 150px; " /></span></p>\n<p>\n	Bungalow Pod&nbsp;<br />\n	30 sqm - indoor floor area<br />\n	4 sqm - porch area<br />\n	34 sqm - total house area<br />\n	75 sqm - min. lot area</p>\n<p>\n	suggested floor plan:<br />\n	1 toilet and bath (included)<br />\n	1 kitchen counter (included)<br />\n	&nbsp;2 bedrooms (suggested only room partitions not included)</p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt="" src="http://amaiapangasinan.weebly.com/uploads/8/3/4/0/8340752/414690.jpg" style="border-top-width: 2px; border-right-width: 2px; border-bottom-width: 2px; border-left-width: 2px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; float: left; width: 250px; height: 150px; " />&nbsp; Twin Pod<br />\n	&nbsp; 50 sqm - indoor floor area<br />\n	&nbsp; 6 sqm - porch area<br />\n	&nbsp; 56 sqm - total house area<br />\n	&nbsp; 130 sqm - min. lot area<br />\n	<br />\n	&nbsp; suggested floor plan:<br />\n	&nbsp; 2 toilet and bath (included)<br />\n	&nbsp; 2 kitchen counter (included)<br />\n	&nbsp; 3 bedrooms (suggested only room partitions not included)</p>\n<p style="margin-left: 120px; ">\n	&nbsp;</p>\n<div>\n	<img alt="" src="http://amaiapangasinan.weebly.com/uploads/8/3/4/0/8340752/4585352.jpg" style="border-top-width: 2px; border-right-width: 2px; border-bottom-width: 2px; border-left-width: 2px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; float: left; width: 250px; height: 167px; " />&nbsp;&nbsp;Single Home<br />\n	&nbsp; 30 sqm - ground floor area<br />\n	&nbsp; 22 sqm - second floor area<br />\n	&nbsp; 4 sqm - porch arrea<br />\n	&nbsp; 56 sqm - total house area<br />\n	&nbsp; 75 sqm - min. lot area<br />\n	&nbsp;&nbsp;<br />\n	&nbsp; suggested floor plan:<br />\n	&nbsp; 1 toilet and bath (included)<br />\n	&nbsp; 1 kitchen counter (included)<br />\n	&nbsp; 3 bedrooms (suggested only, room partitions not included)</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<img alt="" src="http://amaiapangasinan.weebly.com/uploads/8/3/4/0/8340752/5336188.jpg?352" style="border-top-width: 2px; border-right-width: 2px; border-bottom-width: 2px; border-left-width: 2px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; float: left; width: 250px; height: 186px; " />&nbsp; &nbsp; Twin Home<br />\n	&nbsp; &nbsp; 50 sqm - ground floor area<br />\n	&nbsp; &nbsp; 38 sqm - second floor area<br />\n	&nbsp; &nbsp; 6 sqm - porch area<br />\n	&nbsp; &nbsp; 94 sqm - total house area<br />\n	&nbsp; &nbsp; 130 sqm - min. lot area<br />\n	<br />\n	&nbsp; &nbsp; &nbsp;suggested floor plan</div>\n<div>\n	&nbsp; &nbsp; &nbsp;2 toilet and bath (included)<br />\n	&nbsp; &nbsp; &nbsp;2 kitchen counter(included)<br />\n	&nbsp; &nbsp; &nbsp;5 bedrooms (suggested only, room partitions are not included)</div>\n<div>\n	&nbsp;</div>\n<p style="margin-left: 120px; ">\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n'),
(1082, '<h2>\n	Amaia Scapes Pangasinan will soon to open on october 2012</h2>\n<p>\n	This site is owned and created by In house Team Aya La!! of Amaia Scapes Pangasinan..</p>\n<p>\n	Aya La team members:<br />\n	Erwin - Project team leader</p>\n<p>\n	Property Specialist:<br />\n	Henry<br />\n	Felipe<br />\n	Maricel<br />\n	Jackielyn<br />\n	Lea<br />\n	Haniel<br />\n	<br />\n	Aya La (pangasinan dialect) - in filipino &quot;ito na&quot;, in english &quot;this is it&quot; :)</p>\n<p>\n	Aya La team is committed in providing quality service.</p>\n'),
(1084, '<h2>\n	<img alt="" src="http://www.weebly.com/uploads/8/3/4/0/8340752/9577185.jpg" style="float: left; width: 300px; height: 200px; " />&nbsp; Bungalow Pod</h2>\n<p>\n	&nbsp; 30 sqm - indoor floor area<br />\n	&nbsp; 4 sqm - porch area<br />\n	&nbsp; 34 sqm - total house area<br />\n	&nbsp; 75 sqm - min. lot area</p>\n<h3>\n	<br />\n	&nbsp; Estimated Selling Price - 850,000<br />\n	&nbsp; reservation - 7,500</h3>\n<p>\n	<br />\n	<br />\n	<br />\n	<span style="color: blue; ">Sample Computation:&nbsp;Bank financing</span><br />\n	<span style="color: blue; ">20% down payment, 80% balance payable</span></p>\n<p>\n	<strong><ins>20% = 170,000 - down payment (payable up to 12 months no interest)</ins></strong><br />\n	down payment break down:<br />\n	<span style="background-color:lime;"><strong>13,547 - monthly down payment for 12 months no interest</strong></span>&nbsp;<br />\n	&nbsp;<br />\n	<strong><ins>80% = 680,000 - balance payable (BPI,RCBC,BDO,HSBC)</ins></strong><br />\n	14,448 - monthly amortization for 5 years<br />\n	8,986 - monthly amortization for 10 years<br />\n	<span style="background-color:lime;"><strong>7,307 - monthly amortization for 15 years</strong></span><br />\n	<br />\n	note: monthly amortization is computed at usual 10% interest rate per annum. monthly amortization computation may change depending on bank interest rate but will not go higher than 12% interest rate per annum.</p>\n<h4>\n	<span style="background-color:yellow;">minimum of 30,000 monthly income for bank financing<br />\n	minimum of 27,000 monthly income for pag ibig financing</span></h4>\n<p>\n	===============================================================================================</p>\n<p>\n	<img alt="" src="http://www.weebly.com/uploads/8/3/4/0/8340752/414690.jpg" style="float: left; width: 300px; height: 200px; " /></p>\n<h2>\n	&nbsp; Combined Twin Pod</h2>\n<div>\n	&nbsp; 50 sqm - indoor floor area<br />\n	&nbsp; 6 sqm - porch area<br />\n	&nbsp; 56 sqm - total house area<br />\n	&nbsp; 130 sqm - min lot area</div>\n<h3>\n	&nbsp; Estimated Selling Price - 1,500,000<br />\n	&nbsp; reservation - 11,000</h3>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<p style="color: blue; ">\n	<font color="#006600" size="3" style="font-family: Arial, Helvetica, sans-serif; text-align: left; "><strong>Estimated Selling Price - 1,500,000</strong><br />\n	<strong>Reservation - 10,000</strong></font><br />\n	<br style="color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; " />\n	<em style="position: relative; color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; "><font color="#000099">Sample Computation:&nbsp;Bank financing<br />\n	20% down payment, 80% balance payable</font></em><br />\n	<br style="color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; " />\n	<font color="#000000" style="font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; "><u><strong>20% = &nbsp;379,500 (down payment + other charges payable up to 12 months no interest)</strong></u><br />\n	down payment break down:<br />\n	<strong>30,708 - monthly down payment for 12 months no interest</strong>&nbsp;<br />\n	&nbsp;<br />\n	<u><strong>80% = &nbsp;1,200,000 &nbsp;(balance payable BPI,RCBC,BDO,)</strong></u><br />\n	25,496 - monthly amortization for 5 years<br />\n	15,858 - monthly amortization for 10 years<br />\n	<strong>12,895 - monthly amortization for 15 years</strong></font><br />\n	<br style="color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; " />\n	<span style="color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; ">note: monthly amortization is computed at usual 10% interest rate per annum. monthly amortization computation may change depending on bank interest rate but will not go higher than 12% interest rate per annum</span></p>\n<p style="color: blue; ">\n	<span style="color: rgb(70, 78, 84); font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: left; ">=====================================================================================</span></p>\n<p style="color: blue; ">\n	&nbsp;</p>\n'),
