(1192, '<p>\n	<span style="font-size: 24px; font-family: Myriad Pro;">Course Outline</span></p>\n<h3 align="center">\n	BASIC COURSE IN STUFFED TOY MAKING</h3>\n<h3 align="center">\n	&nbsp;</h3>\n<h3>\n	<u>Course Description</u></h3>\n<h3>\n	&nbsp;&nbsp;&nbsp;&nbsp; This course is designed to teach the students/participants how to make their own soft toys using special fabrics and other raw materials intended only for stuffed toy making.</h3>\n<h3>\n	<u>Course Objective</u></h3>\n<h3>\n	&nbsp;&nbsp;&nbsp;&nbsp; This course aims to impart knowledge and skills to interested participants about the basics of soft toy making.&nbsp; By the end of this course, the participants are expected to acquire these knowledge and skills to produce good quality toys for household or commercial purposes.</h3>\n<h3>\n	<u>Course Duration</u></h3>\n<h3>\n	&nbsp;&nbsp;&nbsp;&nbsp; This course requires five days to complete specific tasks and procedures to understand this craft.&nbsp; However, each participant is encouraged to practice continuously, their newly-acquired skill at their own pace in order to master this craft.</h3>\n<h3>\n	&nbsp;</h3>\n<h3>\n	<u>Expected Output per Participant</u></h3>\n<h3>\n	&nbsp;&nbsp;&nbsp;&nbsp; Each participant is expected (1.) to produce patterns and (2.) to finish products namely: a dolphin, a teddy bear and a bird using hand&ndash;sewing techniques.&nbsp; Two extra patterns as homework will also be given to each participant.</h3>\n<h3>\n	&nbsp;</h3>\n<h3>\n	<u>Course Flow</u></h3>\n<h3>\n	&nbsp; &nbsp;LECTURE</h3>\n<h3 style="margin-left: 70.5pt; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tools &amp; Equipment</h3>\n<h3 style="margin-left: 70.5pt; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pattern Literacy</h3>\n<h3 style="margin-left: 70.5pt; ">\n	&middot; &nbsp; &nbsp; &nbsp; &nbsp; PMLCSAF &ndash; The Basic Steps in Stuffed Toy Making</h3>\n<h3 style="margin-left: 70.5pt; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Creative Packaging</h3>\n<h3 style="margin-left: 70.5pt; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Costing</h3>\n<h3>\n	&nbsp; &nbsp;HANDS-ON</h3>\n<h3 style="margin-left: 80px; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pattern Construction</h3>\n<h3 style="margin-left: 80px; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; How to make a Dolphin</h3>\n<h3 style="margin-left: 80px; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; How to make a Teddy Bear</h3>\n<h3 style="margin-left: 80px; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; How to make a Bird</h3>\n<h3 style="margin-left: 80px; ">\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Product Costing &amp; Pricing</h3>\n<h3>\n	&nbsp;</h3>\n<h3>\n	Note:&nbsp; &nbsp;&nbsp;Participants must bring their own sewing kits (needles, white thread, 2 pairs of scissors, etc.)</h3>\n<h3 style="font-size: 12px; ">\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3>\n'),
