(1201, '<h2>\n	Amaia Scapes Capas</h2>\n<p>\n	A sweet deal awaits Tarlace&ntilde;os at Amaia Scapes Capas! This new development of Amaia Land sprawls on a 21.5-hectare land in Capas, Tarlac.</p>\n<p>\n	Complete with all the amenities, like a village pavilion, swimming pool, basketball court and playground, that make up a flourishing community, Amaia Scapes Capas assures your family of a fulfilling abode.</p>\n<p>\n	It will have its own commercial area so your home needs are just a few blocks away from your doorstep. You can also choose from a full line up of house designs to suit your family&#39;s preferences and growing needs. And with Ayala Property Management Corp.&#39;s years of expertise in property management, your family can live safe and secure in the comforts of your Amaia community.</p>\n<p>\n	So sieze the sweetest deal in Tarlac at Amaia Scapes Capas. Your dream to finally own an affordable but quality home is no longer far from your reach kaya talagang Kaya mo na!</p>\n<p>\n	Price Range:&nbsp;P720,000.00 - P1.65M<br />\n	Land area:&nbsp;21.5 hectares for Phase 1<br />\n	Terrain:&nbsp;Relative flat<br />\n	Units:&nbsp;194 house and lot units<br />\n	Location:&nbsp;MacArthur Highway, Brgy. Estrada, Capas, Tarlac</p>\n<p>\n	&nbsp;</p>\n<h1>\n	Location and Vicinity</h1>\n<p>\n	Situated along MacArthur Highway, Amaia Scapes Capas is an easy ride away from the Capas town proper and the Tarlac City suburbs.</p>\n<p>\n	<br />\n	It is efficiently accessible via public access roads, the Luisita Access Road and Concepcion Exit of SCTEX from the South, or the Romulo Highway and Tarlac-Victoria Road from the North.</p>\n<p>\n	Key neighboring locators:&nbsp;</p>\n<ul>\n	<li>\n		Puregold Capas</li>\n	<li>\n		Robinson&#39;s Luisita</li>\n	<li>\n		Hacienda Luisita</li>\n	<li>\n		Capas General Hospital</li>\n	<li>\n		Central Luzon Doctors&#39; Hospital</li>\n	<li>\n		Dominican College of Tarlac</li>\n	<li>\n		Tarlac State University</li>\n	<li>\n		Don Bosco Academy</li>\n</ul>\n<p>\n	&nbsp;</p>\n<h2>\n	Model houses</h2>\n<p>\n	<img alt="multi pod" src="http://www.amaialand.com/fileobj.php?type=2&amp;id=4061" style="width: 200px; height: 133px; " />&nbsp;<img alt="twin homes" src="http://www.amaialand.com/fileobj.php?type=2&amp;id=4059" style="width: 200px; height: 133px; " />&nbsp;<img alt="bungalow pod" src="http://www.amaialand.com/fileobj.php?type=2&amp;id=4057" style="width: 200px; height: 133px; " />&nbsp;<img alt="single home" src="http://www.amaialand.com/fileobj.php?type=2&amp;id=3714" style="width: 200px; height: 133px; " />&nbsp;<img alt="twin homes" src="http://www.amaialand.com/fileobj.php?type=2&amp;id=3720" style="width: 200px; height: 133px; " /></p>\n<p>\n	<br />\n	&nbsp;</p>\n'),
