(1213, '<h2>\n	<span style="font-family: Myriad Pro; font-size: 24px;">The Science of SkinCare</span></h2>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">At ARTISTRY™ SkinCare, we back our products with the best science in the world. Among our top advisors are internationally renowned dermatologists, surgeons and researchers. Many are highly accomplished specialists in key areas like acne treatment, photo-aging or sun damage. Without exception, every ARTISTRY advisor is a leader in the field of skin science. All of our researchers are dedicated to understanding every aspect of the skin, especially:</span></p>\n<ul>\n	<li>\n		<span style="font-family: Myriad Pro; font-size: 24px;">How it ages</span></li>\n	<li>\n		<span style="font-family: Myriad Pro; font-size: 24px;">Why it ages</span></li>\n	<li>\n		<span style="font-family: Myriad Pro; font-size: 24px;">What it needs to protect and repair itself!</span></li>\n</ul>\n<p>\n	&nbsp;</p>\n'),
(1214, '<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">Artistry Exclusive Distibutor</span></p>\n<p style="font-size: 12px;">\n	I am an Independent Business Owner (IBO) as an Artistry Exclusive Distributor and you can be too.</p>\n<p style="font-size: 12px;">\n	We provide distributorship of Artistry Distributorship, consultation and Private Franchasing. Contact us for more information.</p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 20px;">Services</span></p>\n<ul style="font-size: 12px;">\n	<li>\n		Artistry Products Distributorship</li>\n	<li>\n		Artristry Skin Care and Cosmetics Consultation</li>\n	<li>\n		Private Franchising of Artistry Distributorship</li>\n</ul>\n'),
(1216, '<h2 class="big">\n	<span style="font-family: Myriad Pro; font-size: 24px;"><i>Discover</i> a great success story</span></h2>\n<h2>\n	&nbsp;</h2>\n<hr>\n<h4 class="big">\n	<span style="font-family: Myriad Pro; font-size: 24px;">THE <i>HERITAGE</i> OF ARTISTRY</span></h4>\n<h2>\n	&nbsp;</h2>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">The heritage of the ARTISTRY brand started in the 1950’s with an entrepreneurial husband and wife team who went beyond boundaries to bring together science, nutrition and art to inspire revolutionary beauty breakthroughs. Today, ARTISTRY is still leading the way with the most scientifically advanced beauty solutions making it one of the world’s top five premium skincare brands. *</span></p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">*Source Euromonitor International Limited; Beauty and Personal Care 2011, premium cosmetics and premium skincare category and subcategory; global 2010 value RSP.</span></p>\n<hr>\n<h4 class="big">\n	<span style="font-family: Myriad Pro; font-size: 24px;">THE INGREDIENTS OF SUCCESS</span></h4>\n<h2>\n	&nbsp;</h2>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">From the rare fruits of the African plains to the potent botanicals of the Mediterranean shores, ARTISTRY finds the earth’s prized ingredients for superior skincare and anti-aging treatments. The ingredients are then rigorously tested to deliver on what they promise.</span></p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;"><b>African Boabab Fruit</b>: Searching for the world’s precious ingredients, ARTISTRY uncovered the rare extract from the African Baobab Fruit, rich in antioxidants and proven to protect skin’s vibrancy.</span></p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;"><b>Lifesirt Mediterranean Botanical</b>: Imagining how to take anti-aging to new lengths, ARTISTRY brings LifeSirt, a life-extending Mediterranean botanical extract, to help skin resist the signs of aging and reprogram skin’s future for a dramatically youthful look.</span></p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;"><b>Micro-X6 Peptide</b>: ARTISTRY invents what’s next in anti-aging technology with the invention of our exclusive Micro-X6 Peptide, a hexapeptide that repairs skin protein damage. Its six amino acids increase natural collagen activity** and target wrinkles for smoother-looking skin now and into the future.</span></p>\n<hr>\n<h4 class="big">\n	<span style="font-family: Myriad Pro; font-size: 24px;">THE SCIENCE OF <i>FORWARD BEAUTY</i></span></h4>\n<h2>\n	&nbsp;</h2>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">Our cosmetics offer advanced comprehensive foundation shades and modern, sophisticated color palettes. From skincare to color cosmetics, ARTISTRY discoveries bring your beauty forward, further than ever thought possible.</span></p>\n<p>\n	<span style="font-family: Myriad Pro; font-size: 24px;">The inventive nature of his work brings to ARTISTRY the best, most forward-reaching technologies proven to make its beauty and skincare products highly effective</span></p>\n<p>\n	&nbsp;</p>\n<h2>\n	Protect your skin, protect your DNA</h2>\n<h3>\n	Sun exposure can damage your skin''s DNA and disrupt natural cell repair</h3>\n<p>\n	We are all familiar with the benefits of wearing a sunscreen to shield our skin from the sun''s harmful rays. But new scientific discoveries show that the problem is both deeper and more dangerous than previously believed.</p>\n<p>\n	While some may perceive a glow on the skin after sun exposure to be a sign of health, in fact DNA damage is happening deep within the skin. The change in your skin''s color after a few moments in the sun may be visible to everyone, but DNA damage is invisible. This invisible event is dangerous because DNA damage is the direct link to skin cancers and to premature aging.</p>\n<h3>\n	Skin cells'' functions are determined by DNA</h3>\n<p>\n	The skin is comprised of three main layers: epidermis, dermis and hypodermis. (Illustration) Together they perform the role of protection, moisture retention and support. But most important is the fact that these layers know their roles because of the DNA deep inside each skin cell. Much like a computer program, DNA is the genetic material inside each cell that controls the cell''s function. Once DNA is damaged, the skin cells lose their ability to perform their essential roles. Furthermore, damaged cells replicate abnormally and over the years, this damage accumulates accelerating skin aging and increasing your risk of skin cancer.</p>\n<p style="text-align: center;">\n	<img src="http://www.artistry.com/common/images/pages/art-skin-layers.jpg"></p>\n<h3>\n	Sun exposure is a key factor in DNA damage</h3>\n<p>\n	DNA damage largely occurs as a result of free radical attack. Free radicals are generated by many diverse factors, but are primarily the result of ultraviolet rays from the sun.</p>\n<p>\n	Ultraviolet rays are invisible; those most important to the skin are UVB and UVA rays. UVB rays penetrate the topmost layer of the skin. These rays are the primary cause of sunburn, as well as some skin cancers. UVA rays can penetrate deeper into the skin. UVA rays are more likely to cause longer-term effects such as wrinkling, discoloration, a leathery skin appearance, and possibly melanoma (the most serious type of skin cancer).</p>\n<p>\n	Contrary to popular belief, a sunscreen with a high SPF does not necessarily prevent DNA damage and resulting visible skin conditions. The reason for this is that SPF ratings measure only a sunscreen''s effectiveness in blocking UVB rays. But in fact, UVA rays once thought to be harmless because they produce no burning actually penetrate much deeper into the skin leading to much more damage to DNA and other skin structures.</p>\n<h3>\n	The Good News</h3>\n<p>\n	Scientific advancements continue to enable scientists to find more and more ways to support the skin''s natural repair mechanisms. First, using broad-spectrum sunscreen daily is a must as it can protect the skin from the stresses caused by both UVA and UVB penetration, allowing the skin to focus on its normal job of cell repair and regeneration. Secondly, antioxidants can help neutralize free radicals and prevent DNA damage. And last, new technological advancements actually help boost the cell''s natural repair process to reverse DNA damage.</p>\n<hr>\n<h2>\n	Tips: Protecting your skin from dna damage</h2>\n<ul>\n	<li>\n		<b>Follow a consistent, life long approach</b> to healthy skin. Even minimal UV exposure can affect you''re skin''s DNA. Daily use of a broad spectrum sunscreen will help minimize the sun’s effect on the appearance of premature aging.</li>\n	<li>\n		Look for sunscreens that offer "broad-spectrum" or "UVA/UVB" protection or a "PA" rating.</li>\n	<li>\n		The safest option is to avoid sun exposure whenever possible. Minimize exposure between 10 am and 4 pm.v</li>\n	<li>\n		When you go outside, even on a cloudy day, always <b>apply a broad spectrum sun protection product of SPF 15 or higher.</b></li>\n	<li>\n		When outside for extended periods of time or after physical activity (e.g. swimming, tennis, etc.) reapply.</li>\n	<li>\n		Most people do not apply sufficient sun protection product. Be sure to follow instructions on the package.</li>\n	<li>\n		<b>Use self-tanning formulas or bronzers</b> if you desire the look of a tan. But remember that these products do not usually offer any sun protection, so you should always apply protection as well.</li>\n	<li>\n		<b>Stay away from tanning salons</b>. The International Agency for Research on Cancer (IARC), a branch of the World Health Organization (WHO), has unequivocally linked sunbed tanning among young people to melanoma, the deadliest form of skin cancer.</li>\n	<li>\n		<b>Wear protective clothing</b> that will cover arms and legs; choose a hat with a wide brim. Consider UV-protective products such as some window films, sunglasses, and clothing</li>\n</ul>\n'),
