(1341, '<p>\n	<span style="font-size: 24px; font-family: Myriad Pro;">Welcome to your Site</span></p>\n<div class="mhl">\n	EntrepNegosyo is a nation-building community for young entrepreneurs in action.</div>\n<div class="mhl">\n	<div class="mvm uiP fsm">\n		<span class="fwb">Mission</span></div>\n	Our mission is to create a positive change and a global impact by empowering young leaders to build a good nation and love for fellow Filipinos. Young people taking the lead in community solutions<br>\n	By being active in Entrepnegosyo Community and learning new skills, Entrepnegosyo members should be qualified to take the challenge and together, with other active forces in the community, work towards a better future for all.</div>\n<div class="mvm uiP fsm">\n	<span class="fwb">Description</span></div>\n<p>\n	Providing you with the latest business news, bulletin, research, and technology to promote entrepreneurship literacy, awareness and nation building for entrepreneurs. Follow us Twitter facebook @Entrepnegosyo<br>\n	<br>\n	<a href="http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.entrepnegosyo.com%2F&amp;h=oAQHgiogh&amp;s=1" rel="nofollow nofollow" target="_blank">http://www.entrepnegosyo.com/</a><br>\n	Philippine Expo Business Community 2011<br>\n	<br>\n	The website serves as an information gateway, business networking tool, and communication link for both successful and upcoming young entrepreneurs, local and international businessmen, tycoons, and leaders.<br>\n	<br>\n	This aims to promote business by sharing "Business Ideas Secrets in the Philippines" and to inspire Filipinos to live an ENTREPNEGOSYO life in the Philippines.<br>\n	<br>\n	The objectives of this Entrepnegosyo.com / Philippine Business Community and Social Media Network<br>\n	are the following :<br>\n	a. MARKET their respective businesses to members<br>\n	b. SEEK suppliers or leads for products and services<br>\n	c. SHARE information and/or best practices to achieve business growth and sustainability<br>\n	d. IMPART opportunities to participate in new entrepreneurial ventures, and<br>\n	e. GUIDE all of us in achieving personal financial independence.<br>\n	<br>\n	Supplemental to the above-mentioned objectives, there will be regular featured articles in the group, such as on:<br>\n	<br>\n	1. Yahoo! Group members and their respective business interests;<br>\n	2. Sponsored companies and their products and/or services; and<br>\n	3. Business-related news, projects and activities.<br>\n	4. Job oppurtunities around the world.<br>\n	5. Prestigious web advertising and World ''s Best Advertising Website and World Business Forum Online.</p>\n'),
(1342, '<p>\n	<span style="font-size: 24px; font-family: Myriad Pro;">Welcome to your Site</span></p>\n<p>\n	&nbsp;</p>\n<div class="mhl">\n	EntrepNegosyo is a nation-building community for young entrepreneurs in action.</div>\n<div class="mhl">\n	<div class="mvm uiP fsm">\n		<span class="fwb">Mission</span></div>\n	Our mission is to create a positive change and a global impact by empowering young leaders to build a good nation and love for fellow Filipinos. Young people taking the lead in community solutions<br>\n	By being active in Entrepnegosyo Community and learning new skills, Entrepnegosyo members should be qualified to take the challenge and together, with other active forces in the community, work towards a better future for all.</div>\n<div class="mvm uiP fsm">\n	<span class="fwb">Description</span></div>\n<p>\n	Providing you with the latest business news, bulletin, research, and technology to promote entrepreneurship literacy, awareness and nation building for entrepreneurs. Follow us Twitter facebook @Entrepnegosyo<br>\n	<br>\n	<a href="http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.entrepnegosyo.com%2F&amp;h=oAQHgiogh&amp;s=1" rel="nofollow nofollow" target="_blank">http://www.entrepnegosyo.com/</a><br>\n	Philippine Expo Business Community 2011<br>\n	<br>\n	The website serves as an information gateway, business networking tool, and communication link for both successful and upcoming young entrepreneurs, local and international businessmen, tycoons, and leaders.<br>\n	<br>\n	This aims to promote business by sharing "Business Ideas Secrets in the Philippines" and to inspire Filipinos to live an ENTREPNEGOSYO life in the Philippines.<br>\n	<br>\n	The objectives of this Entrepnegosyo.com / Philippine Business Community and Social Media Network<br>\n	are the following :<br>\n	a. MARKET their respective businesses to members<br>\n	b. SEEK suppliers or leads for products and services<br>\n	c. SHARE information and/or best practices to achieve business growth and sustainability<br>\n	d. IMPART opportunities to participate in new entrepreneurial ventures, and<br>\n	e. GUIDE all of us in achieving personal financial independence.<br>\n	<br>\n	Supplemental to the above-mentioned objectives, there will be regular featured articles in the group, such as on:<br>\n	<br>\n	1. Yahoo! Group members and their respective business interests;<br>\n	2. Sponsored companies and their products and/or services; and<br>\n	3. Business-related news, projects and activities.<br>\n	4. Job oppurtunities around the world.<br>\n	5. Prestigious web advertising and World ''s Best Advertising Website and World Business Forum Online.</p>\n'),
(1344, '<p>\n	&nbsp;</p>\n<h2>\n	<a href="http://entrepinoyster.com/about-us/" title="About Us">About Us</a></h2>\n<br>\n<br>\n<div class="entry">\n	<p style="text-align: justify;">\n		&nbsp;We welcome all young and creative innovative entrepreneurs, designers, and or business professionals. We are encouraging everyone to join and become the PIONEERS of this NEW portal for young entrepreneurs in action.</p>\n	<p>\n		*Post and share your ideas, success stories and expand your business network in this online&nbsp;community*</p>\n	<p>\n		Membership &amp; Registration<br>\n		Private Messaging (PM)<br>\n		Free Classified Ads/ Digital Photogallery<br>\n		Interactive Message Board<br>\n		Business Article Submission/Success Stories of Entrepreneurs<br>\n		Directory of Entrepreneur Members</p>\n	<p>\n		1. Featured Stories about Successful young Entrepreneurs<br>\n		2. Classified Ads: Looking For | Selling/Trading<br>\n		3. Announcements: New Businesses | Updates on Existing Businesses | Press Release<br>\n		4. Articles on How to Earn Money<br>\n		5. Business Directory and Forum * Keep up with friends and family * Share photos and videos * Tycoons Success Stories around the World * Reconnect with old classmates * Discuss interests and hobbies * Plan parties and other events</p>\n	<p>\n		Please only post articles that you made or have authority to do so. EntrePinoyster.com is not liable for any copyright issues arising from your posted articles.</p>\n	<p>\n		<strong>Entrepinoyster Team is composed of the following:</strong></p>\n	<p>\n		Johanson Cheng – CEO/Founder/Marketing Head<br>\n		Veneedick Ting – Web Project Manager<br>\n		Ariane Sy – Web Developer/Programmer<br>\n		Pierre Tubalinal – Web Developer/Flash Artist/ Systems Analyst</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		——————————————————————————————————————————————————-</p>\n	<p>\n		<strong>Quazar Web Designs</strong>&nbsp;is a full service, outsource provider&nbsp;of web design services for individuals, companies and&nbsp;organizations based anywhere in the world. It was&nbsp;created with the mission of providing stylish yet&nbsp;affordable websites for individuals, entrepreneurs who&nbsp;wanted to establish their online presence on the world&nbsp;wide web. In 2002,&nbsp;<strong>Quazar Web Designs</strong>&nbsp;established&nbsp;a partnership with a&nbsp;<strong>US Linux server</strong>&nbsp;for its web hosting requirements. Since then, it has grown to be a reputable&nbsp;portal for web services catering to local and foreign clients.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		Studio Address: 7B Tolentino St. SFDM, Quezon City<br>\n		Landline: 411-3674<br>\n		Mobile: 0917-5876442<br>\n		Email: <a href="mailto:info@quazardesigns.net">info</a><a href="mailto:info@quazardesigns.net">@</a><a href="mailto:info@quazardesigns.net">quazardesigns</a><a href="mailto:info@quazardesigns.net">.</a><a href="mailto:info@quazardesigns.net">net</a><br>\n		Website: <a href="http://www.quazardesigns.net/">www</a><a href="http://www.quazardesigns.net/">.</a><a href="http://www.quazardesigns.net/">quazardesigns</a><a href="http://www.quazardesigns.net/">.</a><a href="http://www.quazardesigns.net/">net</a><br>\n		<a href="http://www.quazardesigns.net/">Project</a><a href="http://www.quazardesigns.net/">Manager</a><a href="http://www.quazardesigns.net/">: </a><a href="http://www.quazardesigns.net/">Veneedick</a><a href="http://www.quazardesigns.net/">Ting</a></p>\n	<p>\n		<span style="text-decoration: underline;">&nbsp;</span></p>\n	<p>\n		Client Portfolio includes:</p>\n	<p>\n		<a href="http://www.cggarciarealty.com/">www</a><a href="http://www.cggarciarealty.com/">.</a><a href="http://www.cggarciarealty.com/">cggarciarealty</a><a href="http://www.cggarciarealty.com/">.</a><a href="http://www.cggarciarealty.com/">com</a><br>\n		<a href="http://www.avtech.com.ph/">www</a><a href="http://www.avtech.com.ph/">.</a><a href="http://www.avtech.com.ph/">avtech</a><a href="http://www.avtech.com.ph/">.</a><a href="http://www.avtech