(1349, '<p>\n	&nbsp;</p>\n<div>\n	&nbsp;</div>\n<div>\n	<div class="yiv131245911yui_3_7_2_17_1351471328623_50 yiv131245911yui_3_7_2_53_1351958701885_51 yui_3_7_2_16_1352256593514_55" id="yiv131245911front_heading" style="font-family: Verdana, Arial, sans-serif; height: 30px; padding-top: 5px; color: rgb(57, 57, 57); font-size: 13px; line-height: 18px; background-color: rgb(230, 230, 229); ">\n		<div id="yiv131245911front_heading" style="height: 30px; padding-top: 5px; ">\n			<span id="yiv131245911front_heading_p1"><b id="yiv131245911yui_3_7_2_17_1351471328623_78">TOP 5 REASONS&nbsp;</b></span><span id="yiv131245911front_heading_p2" style="font-size: 15px; ">TO USE BARTER IN YOUR BUSINESS</span></div>\n		<ol class="yiv131245911ol_front" id="yiv131245911yui_3_7_2_17_1351471328623_71" style="margin: 0px 18px; ">\n			<li>\n				<b>Increased Sales:</b>&nbsp;Your business is promoted via emails, newsletters and online. Plus, we personally introduce you to qualified prospects.</li>\n			<li class="yiv131245911ol_front_line" style="margin-top: 6px; ">\n				<b>Fewer Cash Expenses:</b>&nbsp;Don’t spend cash, convert your surplus products, unfilled billable hours, or excess capacity into the goods and services your business needs.</li>\n			<li class="yiv131245911ol_front_line" id="yui_3_7_2_16_1352256593514_66" style="margin-top: 6px; ">\n				<b>Increased Buying Power:</b>&nbsp;Use the barter dollars you earn to get the things you want for your business. You now have access to a whole new source of income.</li>\n			<li class="yiv131245911ol_front_line" id="yui_3_7_2_16_1352256593514_76" style="margin-top: 6px; ">\n				<b>Networking Opportunities:</b>&nbsp;We host networking events throughout the year. Make connections that can lead to new business and profitable alliances.</li>\n			<li class="yiv131245911ol_front_line" id="yiv131245911yui_3_2_0_19_134675164396780" style="margin-top: 6px; ">\n				<b>A Team Dedicated to Your Business:</b>&nbsp;Our mission is to help small &amp; medium-sized businesses thrive ,and take your business to the next level with barter.</li>\n		</ol>\n		( We are &nbsp;now looking for potential licensee/partners in Metro Manila ,Metro Cebu, Metro Davao and other Key Cities in the Philippines ..Please contact 09228832163 look for Mr Bart Abaya &nbsp;or send letter of intent indicating target location &nbsp;email barter.trader@yahoo.com )</div>\n</div>\n<div>\n	&nbsp;</div>\n'),
(1351, '<p>\n	<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; ">MANAGES THE BUYING AND SELLING OF GOODS AND SERVICES ON BEHALF OF ITS MEMBERS IN A CASHLESS ENVIRONMENT,? call 09228832163</span></p>\n'),
