(1383, '<p style="font-size: 12px;">\n	<span style="color:#ffffff;"><span style="font-size: 24px; font-family: Myriad Pro;">Choryo Tooling System</span><br>\n	<br>\n	Manufacturers of Motorcycle Parts and Automotive Equipments</span></p>\n<p style="font-size: 12px;">\n	<img alt="" src="http://issi.upd.edu.ph/bolooka/choryo2.png" width="604" height="451"></p>\n'),
(1384, '<p>\n	&nbsp;</p>\n<p>\n	<span style="font-size: 24px; font-family: Myriad Pro;">About Us</span></p>\n<p>\n	<img alt="" src="http://issi.upd.edu.ph/bolooka/choryo3.png" width="562" height="369"></p>\n<p style="font-size: 12px;">\n	<br>\n	The business activities of Choryo Toolings System Inc. are metal stamping, tool and die, welding, machining and aluminum casting operations. Their office and factory occupies a 4,722 sqm lot in Brgy. Lumil in Silang, Cavite and currently has 132 employees.&nbsp; The corporation has certifications for ISO 9001:2000 and ISO 14001:2004 to meet local and international standards and integrates total customer satisfaction as a prime concern in running the business.&nbsp; It is Choryo’s to goal to “attain and maintain world class status and share its expertise in the nation building effort”.<br>\n	The following is Choryo’s vision, mission and goal:</p>\n<p style="font-size: 12px;">\n	<br>\n	<strong>Company Vision&nbsp; &nbsp;</strong></p>\n<p style="font-size: 12px;">\n	“To promote world class product and services for local and international market taking pride of the Filipino worker’s innovativeness and ingenuity.”</p>\n<p style="font-size: 12px;">\n	<strong>Company Mission&nbsp; &nbsp;</strong></p>\n<p style="font-size: 12px;">\n	“To manufacture high quality products that conform to the international standards and integrate total customer satisfaction as its prime concern.”</p>\n<p style="font-size: 12px;">\n	<strong>Company Goal</strong></p>\n<p style="font-size: 12px;">\n	“Our goal is to attain and maintain world class status and share its expertise in the nation building effort.”<br>\n	&nbsp;</p>\n<p style="font-size: 12px;">\n	<strong>Company Milestone: </strong></p>\n<ul>\n	<li style="font-size: 12px;">\n		1997 Established due to TRI-R tool and die needs</li>\n	<li style="font-size: 12px;">\n		1998 Acquisition of different machines need for manufacture of jig &amp; fixtures and tooling for semicon</li>\n	<li style="font-size: 12px;">\n		2001 Start business with Nidec Copal and National Panasonic</li>\n	<li style="font-size: 12px;">\n		2002 Transferred to new building at Lumil, Silang, Cavite Start business with Matsuhita Communication Group</li>\n	<li style="font-size: 12px;">\n		2003 Start business with Masuda, Tokyo Seat Tech Phils. And Yutaka</li>\n	<li style="font-size: 12px;">\n		2005 ISO 9001:2000 Certified</li>\n	<li style="font-size: 12px;">\n		2006 ISO 14001:2004 Certified</li>\n</ul>\n'),
(1386, '<p>\n	<img alt="" src="http://issi.upd.edu.ph/bolooka/choryo4.png" width="642" height="322"></p>\n<p>\n	<strong><span style="font-size: 20px; font-family: Myriad Pro;">Services</span></strong></p>\n<p>\n	Aluminum Casting</p>\n<p>\n	CNC Lathe</p>\n<p>\n	Metal Stamping</p>\n<p>\n	Welding Assembly</p>\n<p>\n	Die making</p>\n<p>\n	Metal Process</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n'),
