(1439, '<p>\n	<a href="http://www.youtube.com/watch?v=PATkvpm6eI0"><span style="color:#ff0000;">http://www.youtube.com/watch?v=PATkvpm6eI0</span></a></p>\n<p>\n	<span style="color:#ff0000;"><span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">Dance the night away cause it feels right</span></span></p>\n<p>\n	<span style="color:#ff0000;"><span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">You can''t stop me, no-o-o</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">You can''t stop me, no</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">You can''t stop me, no-o-o</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">24/7, 365 with you</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">We know the end is here</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">You can''t stop me, no-o-o</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">If this was the last dance of the night</span><br style="color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 13px; line-height: 17px;">\n	<span style="font-family: arial, sans-serif; font-size: 13px; line-height: 17px;