(1614, '<h4>Escape to a heavenly sanctuary right in your own home. Discover the art of fine living with Locsin&#39;s exotic range of world-class furniture.</h4>\n\n<p style="margin-left: 40px;"><img alt="" src="http://locsin.com/locsin.php?type=6&amp;id=7" style="width: 501px; height: 422px; margin: 5px 10px; border-width: 1px; border-style: solid;" /></p>\n');
INSERT INTO `articles` (`page_id`, `content`) VALUES
(1615, '<p><img alt="" src="http://locsin.com/locsin.php?type=6&amp;id=19" style="width: 350px; height: 295px; float: left; margin: 5px 8px; border-width: 1px; border-style: solid;" />In 1979, Roberto M. Locsin established Locsin International, a Philippine manufacturer and exporter of furniture and lamps together with his wife, Cindelyn B. Locsin. The formidable partnership led to what is now known as a trusted name in the international furniture market.</p>\n\n<p>Today, after more than thirty years of commitment to service excellence, Locsin International continues to flourish as one of the leading makers of premium quality home furniture. Diversity, functionality and innovation drives this company to distinction, as it performs and ensures consistent year-round product research and development initiatives. By continuously exploring and infusing unconventional themes and design concepts into practical living area pieces, this company succeeds in producing and impressive collection to showcase regularly in various exhibitions and fairs here and abroad.</p>\n\n<p>Locsin International commissions freelance designers and continues to find ways to develop young, talented designers. To make this possible, it coordinates with the Chamber of Furniture Industries in The Philippines (CFIP), the national organization that oversees the development of the furniture industry in the country, Locsin International is also an active member of other industry organization such as Philexport.</p>\n\n<p>As testament to its tradition of superior quality, Locsin International has reaped several awards from various government and non-government organizations and institutions.</p>\n'),
(1617, '<h4 class="p1">\n	2007</h4>\n<p class="p1">\n	BEST BOOTH AWARD&nbsp;</p>\n<p class="p1">\n	Manila Fame</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	2006</h4>\n<p class="p1">\n	BEST BOOTH AWARD Cebu X&nbsp;</p>\n<p class="p1">\n	BEST BOOTH AWARD Philippine International Show</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	2003</h4>\n<p class="p1">\n	BEST CONTEMPORARY PRODUCT&nbsp;</p>\n<p class="p1">\n	CATEGORY OF THE MUGNA AWARDS&nbsp;</p>\n<p class="p1">\n	Nominee Cebu Furniture Industries Foundation Inc.&nbsp;</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST IN DESIGN CONSULTANCY&nbsp;</p>\n<p class="p1">\n	Philippine International Furniture Show</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BAGONG SIBOL AWARD&nbsp;</p>\n<p class="p1">\n	Philippine International Furniture Show&nbsp;</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	KATHA AWARDS &ndash; BEST PRODUCT DESIGN</p>\n<p class="p1">\n	Manila Fame</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1998</h4>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST IN PRODUCT DESIGN NOMINEE</p>\n<p class="p1">\n	Philippine International Furniture Show</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST IN PRODUCT DESIGN (Design Consultancy) NOMINEE</p>\n<p class="p1">\n	Philippine International Furniture Show</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST PRODUCT OLLECTION NOMINEE</p>\n<p class="p1">\n	Philippine International Furniture Show</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST IN VISUAL MERCHANDISING</p>\n<p class="p2">\n	&nbsp;</p>\n<p class="p1">\n	LIKHANG PILIPINO AWARD &ndash; BEST IN PRODUCT DESIGN NOMINEE</p>\n<p class="p1">\n	Philippine International Furniture Show</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1995</h4>\n<p class="p1">\n	GOLDEN SHELL AWARDEE</p>\n<p class="p1">\n	Given by Pres. Fidel V. Ramos</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1994</h4>\n<p class="p1">\n	BEST BOOTH AWARD</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1993</h4>\n<p class="p1">\n	BEST BOOTH AWARD</p>\n<p class="p1">\n	BEST PRODUCTION COLLECTION</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1992</h4>\n<p class="p1">\n	BEST PRODUCTION DESIGN</p>\n<p class="p1">\n	BEST BOOTH CITATION</p>\n<p class="p2">\n	BEST BOOTH AWARD</p>\n<p class="p2">\n	&nbsp;</p>\n<h4 class="p1">\n	1991</h4>\n<p class="p1">\n	SPECIAL ECOLOGY AWARD</p>\n'),
