(848, 147, '<p>\n	<font face="Myriad Pro" size="5">Mobile Bar that will give BOOZE to your Parties!</font></p>\n', 'menu2', '0', 'publish', 'About Us', NULL, 2, 'article', '', '', '', '', '', '', '', '', '', '', '', 0),
(849, 147, '0', 'menu3', '0', 'publish', 'Gallery', NULL, 3, 'photo', '', '', '', '', '', '', '', '', '', '', '', 0),
(850, 147, '<p>\n	<strong><u>BOOZETER PACKAGES</u></strong></p>\n<p>\n	<br />\n	<strong>Boozeter 1: </strong>10 mixes out of all menu choices, 500 shots, limited to two (2) flamers and two (2) layered shots &ndash; Php5,000 (approx. 50-75 pax)<br />\n	<br />\n	<strong>Boozeter 2: </strong>15 mixes out of all menu choices, 1000 shots, limited to three (3) flamers and three (3) layered shots &ndash; Php10,000 (approx. 75-130 pax)<br />\n	<br />\n	<strong>Boozeter 3: </strong>20 mixes out of all menu choices, 2000 shots, limited to five (5) flamers and five (5) layered shots &ndash; Php15,000 (approx. 130-200 pax)<br />\n	&nbsp;</p>\n<p>\n	<strong><u>FREEBIES &amp; BAR GAMES:</u></strong><br />\n	<br />\n	- Free use of laser/ strobe lights ( depending on the venue)<br />\n	- Free use of beer bong with free six (6) bottles of local beer<br />\n	- Free use of shot pong table<br />\n	- One (1) free 10 minute rule game<br />\n	- Free use of One (1) unit - Three (3) liters beer tower<br />\n	- Free service of client&#39;s drink/ beverages<br />\n	&nbsp;</p>\n<p>\n	<strong><u>INCLUSIONS</u></strong><br />\n	<br />\n	- Five (5) hours unlimited drinks (shots and flamers)<br />\n	- Personalized Bar Theme<br />\n	- Bar Tenders complete with uniform<br />\n	- Complete Glassware, ice, and equipment<br />\n	&nbsp;</p>\n<p>\n	<strong><u>Notes:</u></strong><br />\n	- Jello shots also available upon request Php 1500 for 50 jello shots<br />\n	- Foreign/ imported spirits refer to menu list</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<div>\n	<strong>MISCELLANEOUS DETAILS</strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Booking Terms:&nbsp;</strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	1. Please book one (1) week before the event</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Visit our facebook page (http://www.facebook.com/partyboozeter) to see our contact information, bar menu/list, and schedules</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Request booking form, fill-up and email it to partyboozeter@gmail.com</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Booking Policies:</strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	1. Book for total number of drinkers only</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Minimum of 50 pax drinkers, additional of php 150/ head in excess of number of drinkers booked</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Guaranteed of 4 to 5 hours of unlimited shots or drinks if tallied to number of drinkers booked</div>\n<div>\n	&nbsp;</div>\n<div>\n	4. Maximum of three (3) servers/ bar tenders per 50 pax, 1000 per additional server</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Mode of Payment:</strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	1. 50% downpayment via bdo bank deposit three (3) days before the event</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Payment may also be made at our home office in quezon city/ meet ups by appointment</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Remaining balance must be paid in cash on the day of the event.</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Customized Bar Themes:</strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	1. Please email layouts / photos One (1) week before the event</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Only one (1) revision is allowed as soon as draft layout is emailed to client</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Standard party boozeter bar layout will be used if no customized bar layout was coordinated/ Emailed within allowable time</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	<strong><u>PACKAGE TERMS AND CONDITIONS</u></strong></div>\n<div>\n	&nbsp;</div>\n<div>\n	1.&nbsp;&nbsp;&nbsp; Party Boozeter Mobile Bar Service will be for maximum five (5) hours or within consumable items last.</div>\n<div>\n	<p>\n		2.&nbsp;&nbsp;&nbsp; All unconsumed alcoholic beverages/ items after the event will be given to the client, client must provide own canisters/ containers.</p>\n	<p>\n		3.&nbsp;&nbsp;&nbsp; Overtime/ Extra charge per hour : Php 500 Bar Setup, &amp; Php 250 per staff.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong><u>GENERAL TERMS AND CONDITIONS</u></strong></p>\n	<p>\n		1.&nbsp;&nbsp;&nbsp; Bar setup will be one (1) hour after ingress and another one (1) hour bar, disassembly for egress.</p>\n	<p>\n		2.&nbsp;&nbsp;&nbsp; Party Boozeter will only transact with clients that are of legal age, otherwise contract will be terminated.</p>\n	<p>\n		3.&nbsp;&nbsp;&nbsp; The client must grant/ permit Party Boozeter to capture &amp; to utilize the event photos for website advertisements &amp; promotional offers.</p>\n	<p>\n		4.&nbsp;&nbsp;&nbsp; Party Boozeter has the right to refuse, control &amp; stop alcohol services to clients/ guests that are under legal age, guests that are allergic to alcohol, guests that will be engaging in long driving &amp; guests that are highly intoxicated. Party Boozeter will not be held liable for any injuries and private property damages that may occur during &amp; after the event caused by the guest to other guest/s, private peroperty/ies or to himself.</p>\n	<p>\n		5.&nbsp;&nbsp;&nbsp; The client shall be liable for all damages &amp; losses to the bar. Charging will be Php 50/ shotglass, Php 100/ container. Damaged Alcohol Bottles will be subject to assessment depending on brand/ type &amp; same assessment will be done for any damages to the bar itself.</p>\n	<p>\n		6.&nbsp;&nbsp;&nbsp; Corkage fee &amp; electrical fees/ utility fees will be the client&rsquo;s responsibility.</p>\n	<p>\n		7.&nbsp;&nbsp;&nbsp; Party Boozeter will not be responsible for lost items/ belongings of the client/guests.</p>\n	<p>\n		8.&nbsp;&nbsp;&nbsp; Party Boozeter has the right to cancel or reschedule bookings during typhoons, flooding, earthquake, et al.&nbsp; A 80% refund on all paid fees will be returned to the client.</p>\n</div>\n<div>\n	&nbsp;</div>\n', 'menu4', '0', 'publish', 'Services', NULL, 4, 'article', '', '', '', '', '', '', '', '', '', '', '', 0),
