(66, 1549, 257, 'Mildura Instant Premix', 'Food & Beverage', 2160, 24, NULL, 'Made from a blend of coarse rice and oats enriched with spirulina powder, Mildura Instant Cereal with Spirulina is a healthy, appetising drink loaded with fibre, protein, amino acids, essential vitamins and minerals.\n\nAn instant high-fibre nutritional beverage that is cholesterol-free and low in sugar, perfect for busy executives, people on the go, students, dieters and the elderly or anyone who wants a quick, nutritious snack that’s light and easily-digestible.\n\nComes in easy-to-prepare convenient sachets so you can enjoy a cuppa anywhere you go. Enjoy it at home, at school, at work, or anywhere at all. ', 1, '83033_m.jpg', 1, 1360824538, 1360829511, '', '', 0),
(69, 1577, 261, 'Cappuccino', 'Food & Beverage', 350, 12, NULL, '<p><font color="#ff0000"><strong>Mildura White Coffee Capucino</strong></font></p>\n\n<p>Enjoy creamy cappuccino minus the hassle of preparation with this pre-mixed cappuccino packed in convenient sachets. You don''t have to worry about measuring and mixing the right amount of coffee and creamer to get that perfect cup of coffee. With Mildura White Coffee Cappuccino, you''re sure to get the same fantastic coffee whenever you want. Just add hot water and savour the rich taste and aroma of fine cappuccino. </p>\n', 1, '27107_m.jpg', 0, 1361015596, 1362975923, '', '', 0),
(70, 1577, 261, 'Cereal With Spirulina', 'Food & Beverage', 450, 12, NULL, '<p><font color="#ff0000"><strong>Mildura Cereal With Spirulina</strong></font></p>\n\n<p>Made from a blend of coarse rice and oats enriched with spirulina powder, Mildura Instant Cereal with Spirulina is a healthy, appetising drink loaded with fibre, protein, amino acids, essential vitamins and minerals. </p>\n\n<p>An instant high-fibre nutritional beverage that is cholesterol-free and low in sugar, perfect for busy executives, people on the go, students, dieters and the elderly or anyone who wants a quick, nutritious snack that’s light and easily-digestible.</p>\n\n<p>Comes in easy-to-prepare convenient sachets so you can enjoy a cuppa anywhere you go. Enjoy it at home, at school, at work, or anywhere at all. </p>\n', 1, '83033_m.jpg', 0, 1361015632, 1362975927, '', '', 0),
(72, 1577, 261, 'Conc Powder Detergent', 'Household', 330, 12, NULL, '<p><font color="#ff0000"><strong>Ecohome Concentrated Powder Detergent</strong></font></p>\n\n<p>Ecomax is a range of eco-friendly household cleaning products with 100% biodegradable ingredients that are carefully formulated for maximum performance and maximum safety.</p>\n\n<p><font color="#009933"><strong>Eco-friendly, Maximum Performance Laundry Detergents</strong></font></p>\n\n<p>Most conventional laundry detergents contain effective cleaning agents like phosphates, nitrates, nonylphenol, optical brighteners and zeolites. However, these ingredients are harmful to humans, the environment and aquatic life.</p>\n\n<p>Ecohome Concentrated Laundry Detergents are made from readily biodegradable cleaning agents that rinse easily leaving no residue on fabrics to cause skin irritation.</p>\n\n<ul>\n<li>No phosphates </li>\n<li>No nitrates  </li>\n<li>No optical brighteners </li>\n<li>No nonylphenol </li>\n<li>No zeolites </li>\n<li>Highly concentrated </li>\n<li>Works well even in cold water (saves on energy required for heating water) </li>\n</ul>\n\n<p><strong>3 times more concentrated than conventional detergents to give you greater savings and more eco-friendly washes.</strong></p>\n\n<p><font color="#009933"><strong>For Ultra-Clean, Ultra-Vibrant Laundry</strong></font></p>\n\n<strong>Ecohome Concentrated Powder Detergent</strong>\nEcohome Concentrated Powder Detergent is a biodegradable laundry compound made from natural enzymes, mineral salts and plant-oil-based cleaning agents that delivers superior cleaning performance, yet cares for your clothes and the environment. \n\n<ul>\n<li>Synergistic cleaning agents – Penetrate deep into fabric fibres to break down and remove even the most stubborn stains. </li>\n<li>Oxybleach – Uses active oxygen to make whites whiter and colours brighter. </li>\n<li>Anti-redeposition – Prevents soil from resettling onto fabrics, rinsing off to an ultra-clean wash. </li>\n<li>UV Protectant & Fabric Care – Protects fabrics from fading and fuzzing to keep them looking new. </li>\n<li>Anti-bacterial – Keeps clothes sanitised and fresh even when drying indoors or soaking overnight. \nLow-sud and anti-rust formula is suitable for all types of washing machines.</li>\n</ul>\n\n<p>Low-sud and anti-rust formula is suitable for all types of washing machines.</p>', 1, '08501_m.jpg', 0, 1361016624, 1362975929, '', '', 0),
