(95, 109, 'Skylight-Hotel-Palawan', 'Skylight Hotel Palawan', 1023, NULL, NULL, 'PH', 'At the center of Puerto Princesa City, Palawan is  one of the Philippines’ famous landmarks. Located 10 minutes from Puerto Princesa International Airport, and a stone’s throw away from the city’s financial district and best attractions, Skylight Hotel is the place to go and stay\n \nThe hotel is surrounded by Palawan’s culturally rich and well preserved historical points of interest, such as Iwahig Penal Colony, Baker’s Hill, Mitra Ranch and many more!\n \nSkylight Hotel Palawan has forty-one (41) elegantly furnished guestrooms .All guestrooms are equipped with air-conditioning system, cable television, hot & cold shower, NDD telephone and Wi-Fi connection for free.\n \nSkylight restaurant and Veranda serves Oriental and International cuisines, Its natural ambiance makes guests comfortable and enjoyable during parties with different occasions (weddings, debuts, birthdays and conventions).\n', 'img/newBackgrounds/Bolooka-63366721.jpg', 'layout1', 1, NULL, NULL, 0, 0),
