(204, 221, 'flamboyantblue', 'Flamboyant Blue', 1000, NULL, NULL, 'PH', 'Flamboyant Blue\n\nSewing stuffed toys and animals can be fun. But there''s nothing more sweet and magical about making a toy than seeing the expression on the face of a little child when they receive it.\n\nThe good thing about making stuffed toys and animals for a child, especially for starters, is that they don''t have to be perfect.  A child is not going to be concerned about the quality of the hand sewing, or if the eyes are lop sided or if one leg is shorter than the other. Each creation is guaranteed unconditional love and hours of play.\n\nSo you''ve decided to make a soft toy, where do you start?\n\nFlamboyant Blue offers kits and patterns for beginners in stuffed toy making.  \n  \n', 'img/newBackgrounds/Bolooka-63366721.jpg', 'layout6', 1, '', NULL, 0, 0),
