(228, 288, 'entrepnegosyocom', 'entrepnegosyocom', 1004, NULL, NULL, '', 'EntrepNegosyo is a nation-building community for young entrepreneurs in action.\nMission\nOur mission is to create a positive change and a global impact by empowering young leaders to build a good nation and love for fellow Filipinos. Young people taking the lead in community solutions\nBy being active in Entrepnegosyo Community and learning new skills, Entrepnegosyo members should be qualified to take the challenge and together, with other active forces in the community, work towards a better future for all.\nDescription\nProviding you with the latest business news, bulletin, research, and technology to promote entrepreneurship literacy, awareness and nation building for entrepreneurs. Follow us Twitter facebook @Entrepnegosyo\n\nhttp://www.entrepnegosyo.com/\nPhilippine Expo Business Community 2011\n\nThe website serves as an information gateway, business networking tool, and communication link for both successful and upcoming young entrepreneurs, local and international businessmen, tycoons, and leaders.\n\nThis aims to promote business by sharing "Business Ideas Secrets in the Philippines" and to inspire Filipinos to live an ENTREPNEGOSYO life in the Philippines.\n\nThe objectives of this Entrepnegosyo.com / Philippine Business Community and Social Media Network\nare the following :\na. MARKET their respective businesses to members\nb. SEEK suppliers or leads for products and services\nc. SHARE information and/or best practices to achieve business growth and sustainability\nd. IMPART opportunities to participate in new entrepreneurial ventures, and\ne. GUIDE all of us in achieving personal financial independence.\n\nSupplemental to the above-mentioned objectives, there will be regular featured articles in the group, such as on:\n\n1. Yahoo! Group members and their respective business interests;\n2. Sponsored companies and their products and/or services; and\n3. Business-related news, projects and activities.\n4. Job oppurtunities around the world.\n5. Prestigious web advertising and World ''s Best Advertising Website and World Business Forum Online.', '', 'layout1', 1, '', 7, 1352216468, 0),
(229, 290, 'barterking', 'Barter King', 1004, NULL, NULL, 'PH', 'TOP 5 REASONS TO USE BARTER IN YOUR BUSINESS\nIncreased Sales: Your business is promoted via emails, newsletters and online. Plus, we personally introduce you to qualified prospects.\nFewer Cash Expenses: Don’t spend cash, convert your surplus products, unfilled billable hours, or excess capacity into the goods and services your business needs.\nIncreased Buying Power: Use the barter dollars you earn to get the things you want for your business. You now have access to a whole new source of income.\nNetworking Opportunities: We host networking events throughout the year. Make connections that can lead to new business and profitable alliances.\nA Team Dedicated to Your Business: Our mission is to help small & medium-sized businesses thrive ,and take your business to the next level with barter.\n( We are  now looking for potential licensee/partners in Metro Manila ,Metro Cebu, Metro Davao and other Key Cities in the Philippines ..Please contact 09175438899 look for Mr Bart Abaya  or send letter of intent indicating target location  email barter.trader@yahoo.com )\n', 'uploads/abarter2.jpg', 'layout1', 1, '', 0, 1352257070, 0),
